import { createContext } from 'react';

const MyContext = createContext();

function App() {
  return (
    <MyContext.Provider value={values}>
      <Routes>
        <Route element={<Layout />}>
          <Route path="/" exact={true} element={<Home />} />
        </Route>
      </Routes>
    </MyContext.Provider>
  );
}

